  - uid: 'azure-arm-datalake-analytics.Job#build'
    id: 'azure-arm-datalake-analytics.Job#build'
    parent: azure-arm-datalake-analytics.Job
    name: 'build(accountName, parameters, options, callback)'
    summary: |-
      Builds (compiles) the specified job in the specified Data Lake Analytics
      account for job correctness and validation.
    fullName: >-
      azure-arm-datalake-analytics.Job.build(accountName, parameters, options,
      callback)
    type: Method
    syntax:
      parameters:
        - id: accountName
          type:
            - string
          description: |-
            The Azure Data Lake Analytics account to execute
            job operations on.
        - id: parameters
          type:
            - object
          description: The parameters to build a job.
        - id: parameters.name
          type:
            - string
          description: the friendly name of the job.
        - id: parameters.type
          type:
            - string
          description: |-
            the job type of the current job (Hive or
            USql). Possible values include: 'USql', 'Hive'
        - id: parameters.degreeOfParallelism
          type:
            - number
          description: |-
            the degree of parallelism
            used for this job. This must be greater than 0.
          optional: true
        - id: parameters.priority
          type:
            - number
          description: >-
            the priority value for the current

            job. Lower numbers have a higher priority. By default, a job has a
            priority

            of 1000. This must be greater than 0.
          optional: true
        - id: parameters.logFilePatterns
          type:
            - array
          description: >-
            the list of log file name

            patterns to find in the logFolder. '*' is the only matching
            character

            allowed. Example format: jobExecution*.log or *mylog*.txt
          optional: true
        - id: parameters.properties
          type:
            - object
          description: the job specific properties.
        - id: parameters.properties.runtimeVersion
          type:
            - string
          description: >-
            the runtime version

            of the Data Lake Analytics engine to use for the specific type of
            job being

            run.
          optional: true
        - id: parameters.properties.script
          type:
            - string
          description: the script to run
        - id: parameters.properties.type
          type:
            - string
          description: Polymorphic Discriminator
        - id: options
          type:
            - object
          description: Optional Parameters.
          optional: true
        - id: options.customHeaders
          type:
            - object
          description: |-
            Headers that will be added to the
            request
          optional: true
        - id: callback
          type:
            - function
          description: ''
      return:
        type:
          - function
        description: |-
          callback(err, result, request, response)

                               {Error}  err        - The Error object if an error occurred, null otherwise.

